var upload = function (eleId, layUpload, done,extendParam, error, accept, exts) {
        layUpload.render({
            elem: eleId //绑定元素
            , url: uploadPath //上传接口--此处通过配置的全局变量获取
            , accept: accept === undefined ? 'file' : accept
            , exts: exts === undefined ? 'jpg|png|gif|bmp|jpeg|doc|docx' : exts
            , data: extendParam
            , done: function (res) {
                //上传完毕回调
                if (typeof (done) === 'function') {
                    console.log(res);
                    if (res.code === '0'){
                        done(res.data);
                    }
                }
            }
            , error: function () {
                //请求异常回调
                if (typeof (error) === 'function') {
                    error()
                }
            }
        });
    };

