package ruletemplate.save;
import java.util.Map;
import java.util.Date;
import java.util.Set;
import java.lang.String;
import org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;

rule "passwordRule"

dialect "java"
no-loop true
  when
     $map:Map(this['password'] != null&&this['password']!=""&&this['parentId']!="null") //正确的写法
  then
    BCryptPasswordEncoder encoder = new BCryptPasswordEncoder();
    String passEncode = encoder.encode(String.valueOf($map.get("password")));
     $map.put("password",passEncode );
  end

package ruletemplate.query;
import java.util.Map;
import java.util.Date;
import java.util.Set;
import java.lang.String;
global com.wldst.ruder.module.database.DbInfoService dbGather;

rule "queryDbTableRule"

dialect "java"
no-loop true
  when
     $map:Map(this['dsId'] == null) //正确的写法
  then
       $map.put("dsId",dbGather.getDsId());
  end

